  function setAmt(uint256 newAmt) public returns(bool) {
        uint256 oldAmt = TotalAmt;
        TotalAmt = newAmt;
        emit UpdatedAmt(oldAmt, newAmt);
        return true;
  }

  function getAmt() public view returns (uint256) {
        //uint256 surchargefees = 10;
